import React from "react";
import "./App.css";
import Header from "./components/Header/Header";
import Profile from "./components/Profile/Profile";
import Sidebar from "./components/Sidebar/Sidebar";
import {
  BrowserRouter,
  Switch,
  Route,
  Routes,
  Link,
  NavLink
} from "react-router-dom";

function App() {
  //let likes = 0

    return (
      <BrowserRouter>
        <div className="app-wrapper">
          <Header />
          <Sidebar />
          <main className="maincontent">
          <Routes>
            <Route path="/profile" element={<Profile />} />
            <Route path="/dialogs" element={<Dialogs />} />
            <Route path="/dialogs/*" element={<Dialogs />} />
            <Route path="/news" element={<News />} />
            <Route path="/hello" element={<Hello />} />
            <Route path="*" element={<NotFound />} />
          </Routes>
          </main>
        </div>
      </BrowserRouter>
    );
}

//new page
const News = () => {
  return <h2>Here's News</h2>;
}
const Hello = () => {
  return <h2>Here's Helloooo!!!! I'm in processing...</h2>;
}
const NotFound = () => {
  return <h2>Error 404! Not Found Page</h2>;
}

//**** page Dialogs */
const DialogItem = (props) => {
  let path = '/dialogs/' + props.id

  return (
    <div className="ttest">
      {/* <NavLink to={path}>{ props.name }</NavLink> */}
      <NavLink to={props.id}>{ props.name }</NavLink>
    </div>
  )
}

const Message = (props) => {
  return (
    <div className="dialog__messages--item">{ props.message }</div>
  )
}

const Dialogs = (props) => {
  return (
    <div className="dialogs">
      <div className="dialogs__names">
        <DialogItem name="Josef" id='1' />
        <DialogItem name="Dima" id='2' />
        <DialogItem name="Roman" id='3' />
        <DialogItem name="Greg" id='4' />
        <DialogItem name="Nadya" id='5' />
        <DialogItem name="Masha" id='6' />
      </div>
      <div className="dialog__messages">
        <Message message='Hi !' />
        <Message message='How are you?' />
        <Message message='Sheat happed' />
      </div>
    </div>
  )
}
//*** End Dialogs */

export default App;
